import React from 'react';
import {Route as ReactDOMRoute, useHistory} from 'react-router-dom';

const Route = ({
    isPrivate = false,
    component: Component,
    ...rest  
})=>{

    const history = useHistory();

    const user = {
        nome: 'carlos',
    }

    if (!(isPrivate === !!user)) {
        history.push(isPrivate ? '/login':'/main');
    }
    
    return(
        <ReactDOMRoute {...rest}
        render={(props)=>{
          return (
              <Component {...props}/>
          )  
        }}
        />
    )
}
export default Route;
